 Sur les autres projets Wikimedia : Cet article possède des  paronymes , voir  Chat (homonymie) ,  Chat ,  Le Chat  et  Black Cat .
 Au sens littéral,  chat noir , fait référence à la  robe noire  du  chat , associée à de nombreuses superstitions ;
